import React from 'react';
import './App.css';
import Sidebar from './Components/SideBar/Sidebar';
import Hero from "./Components/Main/Hero/Hero";

function App() {
    return (
        <div className="App">
            <Sidebar/>
            <main className={"contentContainer"}>
                <Hero />
            </main>
        </div>
    );
}

export default App;
